import PokedexList from './PokedexList'

export default function Pokedex() {
  const [pokemon, setPokemon] = useState();

  useEffect(() => {
    fetch(`https://pokeapi.co/api/v2/pokemon/`)
      .then(res => res.json())
      .then(data => setPokemon(data));

  }, []);

  return (
    <>

    <div></div>
    <PokedexList></PokedexList>
    </>
  )
}
